import React, {useState} from "react";
import FullRecordList from "../components/FullRecordList";

const GetByName = function () {
    const [surname, setSurname] = useState("")
    const [name, setName] = useState("")
    const [patronymic, setPatronymic] = useState("")
    const [addresses, setAddresses] = useState([])

const GetByName = () => {
    fetch("http://localhost:9000/find_by_name?surname="+surname+"&name="+name+"&patronymic="+patronymic, {
        method: 'GET',
        headers: {
            "Access-Control-Allow-Origin": "*"
        }
    })
      .then(response => response.json())
      .then(result => {
          if (result.error.code === 404) {
              setAddresses([])
              return
          }
          setAddresses(result.addresses)
      })
    // .catch(e => {
    //   console.log(e);
    //   setData(e)});
}

    return (
      <div>
          <input className="input_text" type="text" placeholder="Имя" value={surname} onChange={e => setSurname(e.target.value)} />
          <input className="input_text" type="text" placeholder="Фамилия" value={name} onChange={e => setName(e.target.value)} />
          <input className="input_text" type="text" placeholder="Отчество" value={patronymic} onChange={e => setPatronymic(e.target.value)} />

          <FullRecordList recs={addresses} />
      </div>
    )
}


export default GetByName
